INSERT INTO `v1_77030360d327711acfa55ae647052fcc086c9421a2ead63c2fcae45a9ff837bf` VALUES (160, "仲間と夏を楽しむ、夏海の魔法士。自分を変えたいという固い決意で、障害物を無効化して走り続ける。", 1, 110, 1, 1.5, 0.029, 0, 0, 122601, 1, 1, 105, 101);
INSERT INTO `v1_77030360d327711acfa55ae647052fcc086c9421a2ead63c2fcae45a9ff837bf` VALUES (120, "太陽よりも輝く、夏海の元気娘。　持ち前の身体能力で、どんなコースも柔軟に対応し、駆け抜ける。", 2, 105, 0, 2.5, 0.014, 0, 1, 122401, 2, 3, 111, 102);
INSERT INTO `v1_77030360d327711acfa55ae647052fcc086c9421a2ead63c2fcae45a9ff837bf` VALUES (350, "波打ち際に煌めく、夏海の剣士。　日々の鍛錬で鍛えた脚で、長い距離も速度を落とさず走り切る。", 3, 110, 0, 2.5, 0.017, 1, 0, 122501, 3, 2, 105, 103);
INSERT INTO `v1_77030360d327711acfa55ae647052fcc086c9421a2ead63c2fcae45a9ff837bf` VALUES (130, "海の幸に目がない、渚のお姫様。　『王家の装備』の力を解放し、障害物をものともせず前へと進む。", 4, 110, 0, 1.5, 0.016, 0, 1, 107501, 4, 3, 105, 104);
INSERT INTO `v1_77030360d327711acfa55ae647052fcc086c9421a2ead63c2fcae45a9ff837bf` VALUES (160, "海でも主さまをお世話する、白浜の巫女。精霊の力で自身を加速させ、誰よりも速くゴールを目指す。", 5, 110, 1, 2.5, 0.014, 0, 0, 107601, 5, 1, 105, 105);
INSERT INTO `v1_77030360d327711acfa55ae647052fcc086c9421a2ead63c2fcae45a9ff837bf` VALUES (255, "水着姿を恥じらう、ツンデレ猫娘。お得意の魔法で、対戦相手の走りを妨害し、レースを有利に進める。", 6, 120, 0, 3.5, 0.029, 1, 0, 107801, 6, 2, 103, 106);
INSERT INTO `v1_77030360d327711acfa55ae647052fcc086c9421a2ead63c2fcae45a9ff837bf` VALUES (160, "優雅に浜を駆ける、真夏のマホ姫。しゃなりしゃなりと、雅な身のこなしで障害物を跳び越えていく。", 7, 120, 1, 3.5, 0.013, 0, 0, 110601, 7, 1, 103, 107);
INSERT INTO `v1_77030360d327711acfa55ae647052fcc086c9421a2ead63c2fcae45a9ff837bf` VALUES (350, "浜の平和を守る、真夏の狼娘。　　獣人の強靭なスタミナで、レース　後半にスパートをかける。", 8, 110, 0, 2.5, 0.014, 1, 0, 110401, 8, 2, 103, 108);
INSERT INTO `v1_77030360d327711acfa55ae647052fcc086c9421a2ead63c2fcae45a9ff837bf` VALUES (130, "浜に力強く舞う、真夏の南国娘。　レースの喧噪の中でも精神を乱さず後半に大きな捲りを見せる。", 9, 105, 0, 1.5, 0.012, 0, 1, 110501, 9, 3, 100, 109);
INSERT INTO `v1_77030360d327711acfa55ae647052fcc086c9421a2ead63c2fcae45a9ff837bf` VALUES (200, "浜の事件を嗅ぎ付けた、真夏の　　名探偵。高い推理力と魔法で、的確に対戦相手の走りを乱す。", 10, 105, 1, 2.5, 0.014, 0, 0, 115701, 10, 1, 103, 110);
INSERT INTO `v1_77030360d327711acfa55ae647052fcc086c9421a2ead63c2fcae45a9ff837bf` VALUES (350, "再び鎧を脱いだ、灼熱の騎士団長。実戦で培った判断力で、瞬時にバリアを展開し、障害物を無力化する。", 11, 105, 0, 2.5, 0.071, 1, 0, 113601, 11, 2, 103, 111);
INSERT INTO `v1_77030360d327711acfa55ae647052fcc086c9421a2ead63c2fcae45a9ff837bf` VALUES (130, "水が苦手な、海辺の気まぐれ猫娘。浜に現れた美少女義賊は、対戦相手のスピードを奪いとる。", 12, 120, 0, 1.5, 0.014, 0, 1, 107901, 12, 3, 103, 112);
INSERT INTO `v1_77030360d327711acfa55ae647052fcc086c9421a2ead63c2fcae45a9ff837bf` VALUES (200, "バカンスも効率第一な、海の傭兵。レースでも最高効率を求め、どんな状況でも隙のない走りを見せる。", 13, 110, 1, 1.5, 0.022, 0, 0, 108001, 13, 2, 105, 113);
INSERT INTO `v1_77030360d327711acfa55ae647052fcc086c9421a2ead63c2fcae45a9ff837bf` VALUES (160, "真夏の太陽が良く似合う、海辺の　サレンママ。多才で器用、どんな　障害物もエレガントに越えていく。", 14, 110, 1, 2.5, 0.031, 0, 0, 110301, 14, 1, 108, 114);
INSERT INTO `v1_77030360d327711acfa55ae647052fcc086c9421a2ead63c2fcae45a9ff837bf` VALUES (130, "海に嵐を呼ぶ夏のドジっ娘メイド。日頃から災難に慣れており、多少　のトラブルには動じたりしない。", 15, 110, 0, 0.5, 0.036, 0, 1, 107701, 15, 1, 105, 115);
INSERT INTO `v1_77030360d327711acfa55ae647052fcc086c9421a2ead63c2fcae45a9ff837bf` VALUES (350, "粋な夏を愉しむ、若夏の姉御。　　流麗な身体捌きで、始・継・終と、UBを重ねるごとに、加速する。", 16, 110, 0, 3.5, 0.048, 1, 0, 113101, 16, 2, 95, 116);
INSERT INTO `v1_77030360d327711acfa55ae647052fcc086c9421a2ead63c2fcae45a9ff837bf` VALUES (130, "夏のトキメキに触れた、オタク魔法少女。多彩な魔法を操り、少しずつ他の走者の速度を落とし続ける。", 17, 105, 0, 1.5, 0.043, 0, 1, 113301, 17, 3, 105, 117);
INSERT INTO `v1_77030360d327711acfa55ae647052fcc086c9421a2ead63c2fcae45a9ff837bf` VALUES (130, "海獄に降臨せし、真夏の冥姫。　　レース後半に魔力を全解放し、　　蒼き疾風と成りて浜を駆け抜ける。", 18, 105, 0, 1.5, 0.018, 0, 1, 113201, 18, 2, 95, 118);
INSERT INTO `v1_77030360d327711acfa55ae647052fcc086c9421a2ead63c2fcae45a9ff837bf` VALUES (160, "夏の夕を火花で彩る、渚の壊し屋。『壊し屋』の異名と過激な愛情は、対戦相手にプレッシャーを与える。", 19, 110, 1, 2.5, 0.021, 0, 0, 117001, 19, 2, 108, 119);
INSERT INTO `v1_77030360d327711acfa55ae647052fcc086c9421a2ead63c2fcae45a9ff837bf` VALUES (255, "青春に生きる者を導く、夏の先生。夢へと邁進する聖母の加護が、その身をあらゆる困難から守る。", 20, 110, 0, 2.5, 0.036, 1, 0, 113501, 20, 1, 105, 120);
INSERT INTO `v1_77030360d327711acfa55ae647052fcc086c9421a2ead63c2fcae45a9ff837bf` VALUES (350, "笑顔の応援が眩しい、夏の超能力　ガール。超能力を駆使して、どんな障害物もひとっ飛びで乗り越える。", 21, 105, 0, 2.5, 0.02, 1, 0, 113401, 21, 3, 105, 121);
INSERT INTO `v1_77030360d327711acfa55ae647052fcc086c9421a2ead63c2fcae45a9ff837bf` VALUES (130, "海辺で大人の魅力を放つ、夏の　　セクシー先生。その魅力に囚われた対戦相手は、走りを乱してしまう。", 22, 110, 0, 2.5, 0.018, 0, 1, 110101, 22, 1, 105, 122);
INSERT INTO `v1_77030360d327711acfa55ae647052fcc086c9421a2ead63c2fcae45a9ff837bf` VALUES (160, "水着も絶対外さない、夏のカリスマモデル。走りのバイブスは超テンアゲで、スピードはおにやば。", 23, 105, 1, 3.5, 0.03, 0, 0, 110001, 23, 3, 111, 123);
INSERT INTO `v1_77030360d327711acfa55ae647052fcc086c9421a2ead63c2fcae45a9ff837bf` VALUES (130, "南の島も盛り上げる、真夏のアイドル。悪天候でも笑顔を絶やさず後半もリズムを上げて走り切る。", 24, 110, 0, 1.5, 0.027, 0, 1, 117201, 24, 1, 103, 124);
INSERT INTO `v1_77030360d327711acfa55ae647052fcc086c9421a2ead63c2fcae45a9ff837bf` VALUES (160, "海原に美声を響かす、渚の歌姫。　守護の賛歌と精霊の加護により、　障害物から身を守る。", 25, 105, 1, 3.5, 0.02, 0, 0, 117301, 25, 2, 108, 125);
INSERT INTO `v1_77030360d327711acfa55ae647052fcc086c9421a2ead63c2fcae45a9ff837bf` VALUES (350, "夏でも天邪鬼な、夕凪のテーラー。張り巡らされた魔法の糸で、他の走者の自由を奪う。", 26, 110, 0, 2.5, 0.04, 1, 0, 117401, 26, 3, 105, 126);
INSERT INTO `v1_77030360d327711acfa55ae647052fcc086c9421a2ead63c2fcae45a9ff837bf` VALUES (350, "向日葵が良く似合う、海辺の　　　お姉ちゃん。秘密結社の一員で、　抜群の身体能力が一番の武器。", 27, 110, 0, 3.5, 0.009, 1, 0, 117101, 27, 1, 105, 127);
INSERT INTO `v1_77030360d327711acfa55ae647052fcc086c9421a2ead63c2fcae45a9ff837bf` VALUES (255, "渚でおっとり、夏色うさぎっこ。　うさぎさんパワー全開で、ぴょん　ぴょんとコースを跳ね回る。", 28, 120, 0, 3.5, 0.022, 1, 0, 122901, 28, 1, 105, 128);
INSERT INTO `v1_77030360d327711acfa55ae647052fcc086c9421a2ead63c2fcae45a9ff837bf` VALUES (130, "無邪気さ弾ける、夏色いたずら娘。砂浜でも、いたずらの準備は万端！レースに大波乱が巻き起こる！？", 29, 110, 0, 2.5, 0.028, 0, 1, 122801, 29, 3, 105, 129);
INSERT INTO `v1_77030360d327711acfa55ae647052fcc086c9421a2ead63c2fcae45a9ff837bf` VALUES (130, "海でも真面目な、夏色優等生。　　高めた魔力を解き放ち、一瞬の内に他の走者を置き去りにする。", 30, 105, 1, 3.5, 0.023, 0, 0, 122701, 30, 2, 108, 130);
